        if(!$daoCollections)
        {
            $daoCollections = new DataObject\Folder();
            $daoCollections->setParentId(1);
            $daoCollections->setKey("KOLEKCJE");
            $daoCollections->save();

            $this->writeInfo("DataObject folder /KOLEKCJE added.");
        }

